sys_variable_value.value:
(function execute(inputs, outputs) {
  var followOnClin = new FundingService().getFollowOnCLIN(inputs.clinRecord);
  if (followOnClin) {
	outputs.follow_on_clin = followOnClin;
  }
  else {
    outputs.follow_on_clin = inputs.clinRecord;
  }
})(inputs, outputs);

